import { Home } from './Pages/Home';
import PerfilUsuario from './Layouts/PerfilDesplegable';

function App() {
  return (
  <Routes>
    <Route path='/' element={<Home/>}/>
    <Route path='/home' element={<PerfilUsuario/>}/>
  </Routes>
  );
}

export default App;
